-- drop table if exists AGENS_USER_LOGS;
create table if not exists AGENS_USER_LOGS (
  ID int not null AUTO_INCREMENT,
  USER_NAME varchar(100) not null,
  USER_IP varchar(100) not null default '',
  QUERY varchar(4000) not null default '',      -- length=4000, A4 size, for Oracle DB compatibility
  STATE varchar(100) not null default '',
  MESSAGE varchar(4000) null default '',        -- length=4000, A4 size, for Oracle DB compatibility
  CREATE_DT timestamp default CURRENT_TIMESTAMP,
  UPDATE_DT timestamp default CURRENT_TIMESTAMP,
  primary key (ID)
) AUTO_INCREMENT=2001 CHARSET=utf8;
